import React from "react";
import Frame19543 from "../Frame19543";
import Frame36292 from "../Frame36292";
import Standart from "../Standart";
import Standart2 from "../Standart2";
import Placeholder from "../Placeholder";
import Standart3 from "../Standart3";
import Standart4 from "../Standart4";
import Frame5 from "../Frame5";
import Frame51 from "../Frame51";
import Component12 from "../Component12";
import Frame3 from "../Frame3";
import EditPlus from "../EditPlus";
import "./X14AdminPaneladdNewProductConfirmat.css";

function X14AdminPaneladdNewProductConfirmat(props) {
  const {
    addProduct,
    rectangle15,
    confirmation,
    text52,
    frame19543Props,
    frame36292Props,
    standartProps,
    standart2Props,
    placeholderProps,
    standart3Props,
    standart4Props,
    frame5Props,
    frame51Props,
    component12Props,
    frame3Props,
    frame52Props,
    editPlusProps,
  } = props;

  return (
    <div className="x1-4-admin-panel-add-new-product-confirmation screen ">
      <div className="group-1945">
        <Frame19543
          dashboard={frame19543Props.dashboard}
          editSearch2Props={frame19543Props.editSearch2Props}
          basicSettingsProps={frame19543Props.basicSettingsProps}
          frame3623Props={frame19543Props.frame3623Props}
        />
        <Frame36292
          welcomeBack={frame36292Props.welcomeBack}
          arrowChevron_big_left2Props={frame36292Props.arrowChevron_big_left2Props}
        />
        <div className="frame-2829 border-0-5px-abbey">
          <Standart
            spanText={standartProps.spanText}
            spanText2={standartProps.spanText2}
            standartI61591083={standartProps.standartI61591083}
          />
          <Standart2
            titleI6159109347={standart2Props.titleI6159109347}
            standartI61591093={standart2Props.standartI61591093}
          />
          <Placeholder text40={placeholderProps.text40} />
          <Standart3
            spanText={standart3Props.spanText}
            spanText2={standart3Props.spanText2}
            standartI61591133={standart3Props.standartI61591133}
          />
          <Standart4
            spanText={standart4Props.spanText}
            spanText2={standart4Props.spanText2}
            standartI61591143={standart4Props.standartI61591143}
          />
          <div className="frame-3">
            <div className="add-product valign-text-middle ibmplexsans-semi-bold-shark-16px">{addProduct}</div>
          </div>
          <Frame5 cancel={frame5Props.cancel} />
          <Frame51 image2={frame51Props.image2} userUserProps={frame51Props.userUserProps} />
        </div>
        <Component12
          text38={component12Props.text38}
          frame1945Props={component12Props.frame1945Props}
          frame3509Props={component12Props.frame3509Props}
          frame3500Props={component12Props.frame3500Props}
          layer2Props={component12Props.layer2Props}
          className="component-13"
        />
      </div>
      <img className="rectangle-15" src={rectangle15} />
      <div className="frame-35373 border-0-5px-abbey">
        <div className="confirmation ibmplexsans-semi-bold-quarter-spanish-white-24px">{confirmation}</div>
        <p className="text-52 ibmplexsans-normal-quarter-spanish-white-16px">{text52}</p>
        <Frame3 leavePage={frame3Props.leavePage} />
        <Frame5 cancel={frame52Props.cancel} className="frame-5-1" />
        <EditPlus editPlus={editPlusProps.editPlus} className="menu-closebig" />
      </div>
    </div>
  );
}

export default X14AdminPaneladdNewProductConfirmat;
